void GetShouPin(unsigned char *input, unsigned char *shoupin)
{
	int i, j, pos;
	int ShouleBeLetter = 1;

	i = 0;
	j = 0;
	pos = 0;
	while(input[i] != '\0')
	{
		if(input[i] <= 0x7F)
		{
			if(input[i] >= '0' && input[i] <= '9')
			{
				shoupin[j] = input[i];
				j++;
				ShouleBeLetter = 1;
			}
			else if(input[i] >= 'a' && input[i] <= 'z')
			{
				if(ShouleBeLetter)
				{
					shoupin[j] = input[i];
					j++;
					ShouleBeLetter = 0;
				}
			}
			else if(input[i] >= 'A' && input[i] <= 'Z')
			{
				if(ShouleBeLetter)
				{
					shoupin[j] = input[i] + 0x20;
					j++;
					ShouleBeLetter = 0;
				}
			}
			else if(input[i] == 0x20 || input[i] == 0x2E || input[i] == 0x27)
			{
				ShouleBeLetter = 1;
			}
			
			i++;
		}
		else
		{
			if((input[i] >= 0xB0 && input[i] <= 0xF7) && ((input[i + 1] >= 0xA1 && input[i + 1] <= 0xFE)))
			{
				pos = (input[i] - 0xB0) * (0xFE - 0xA1 + 1) + (input[i + 1] - 0xA1);	
				shoupin[j] = gPinYin[pos];
				j++;
				ShouleBeLetter = 1;
				i += 2;
			}
			else
				i ++;
		}
	}	
	shoupin[j] = '\0';
}

int GetWordsCount(char *GBString)
{
	int i;
	int Len;
	int Ret;
	char *pStr;

	Ret = 0;
	pStr = GBString;
	Len = strlen(GBString);
	for (i = 0; i < Len; i++)
	{
		if (pStr[i] & 0x80)
		{
			i++;
		}
		Ret++;
	}

	return Ret;
}

