int MCodeConvert_UCS2toUTF8Code(char* in_ucs2, char* out_utf8, int Len1, int Len2)
{
	unsigned char buff[12];
	short *inp = (short*)in_ucs2;
	char *outp = out_utf8;
	int len_out,len_in, temp;

	len_out = 0;
	len_in = 0;
	while(len_in < Len1)
	{
		memset(buff, 0, 12);
		temp = UCS2toUTF8Code(*inp, buff);
		len_out += temp;
		if(len_out > Len2)
			break;
		len_in+=sizeof(short);
		inp++;
		memcpy(outp,buff,temp);
		outp += temp;
	}

    return len_out; 
}






